         // const hexaToRgba = hexToRgba(tag.colorTag);\n            // const getValueRba = hexaToRgba.split('(')[1].split(',').filter((elem) => typeof filterInt(elem) === 'number');\n            // tag.r = filterInt(getValueRba[0].trim());\n            // tag.g = filterInt(getValueRba[1].trim());\n            // tag.b = filterInt(getValueRba[2].trim());\n            // tag.a = filterInt(getValueRba[3].replace(')', '').trim());\n            exaToRgbaObject(tag.colorTag, tag);\n            return tag;\n          });\n        }\n        return d;\n      });\n      return data;\n    }));\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"controllers/GreenScoreController.html":{"url":"controllers/GreenScoreController.html","title":"controller - GreenScoreController","body":"\n                   \n\n\n\n\n\n\n  Controllers\n  GreenScoreController\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/green-score/green-score.controller.ts\n        \n\n            \n                Prefix\n            \n            \n                green-score\n            \n\n\n\n\n\n\n    \n\n\n    \n        import { Controller } from '@nestjs/common';\n\n@Controller('green-score')\nexport class GreenScoreController {}\n\n    \n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/GreenScoreModule.html":{"url":"modules/GreenScoreModule.html","title":"module - GreenScoreModule","body":"\n                   \n\n\n\n\n    Modules\n    GreenScoreModule\n\n\n\n    \n        \n\n\n\n\n\ndependencies\n\nLegend\n\n Declarations\n\n Module\n\n Bootstrap\n\n Providers\n\n Exports\n\ncluster_GreenScoreModule\n\n\n\ncluster_Green